import React, { useEffect, useState } from "react";
import axios from "axios";
import { useAuth } from "../user/AuthUserContext";

const ReadPost = () => {
  const { userData } = useAuth();
  const idUser = userData.id_User;
  const autor=userData.st_NombreUser;

  const [data, setData] = useState([]);

  const URL = `http://localhost:3011/getpostsuser/${idUser}`;

  const loadData = async () => {
    const response = await axios.get(URL);
    setData(response.data);
    console.log(response.data);
  };
  useEffect(() => {
    loadData();
  }, []);

  return (
    <div className="container-fluid">
    <div className="row">
      <div className="col cardhome">
        <h1>Mis Posts</h1>
        <h2>Autor: {autor}</h2>

        <div className="row">
          {data.map((item, index) => (
            <div className="col-md-6" key={index}>
              <div className="cardposts">
                <div className="card cardposts">
                  <div className="card-body">
                    <h3 className="card-title">Titulo: {item.st_Titulo}</h3>
                    <div className="cardhome">{item.st_Contenido}</div>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  </div>
  );
};

export default ReadPost;
